window.bookSummaryJSON = "<p><b>Now a complete series in one box set!</b></p> <p>In the Ocelot kingdom, shifters rule, and humans are nothing. </p> <p>As a princess, you’d think I lived a blessed life. But like all second-born children of shifter couples, I am a lowly human. The most I can hope for is that when my older sister takes the throne, she’ll consider me unimportant enough to let me marry for love. </p> <p>First, I have to get her to the throne.</p> <p>After a devastating betrayal by our father, I vow to get Camila the crown—now. To become queen, she must collect an amulet that contains secrets to the mating rituals of each feline clan. I’ll do anything to help my fragile sister gain the first amulet, from seducing a jaguar noble to submitting to a billionaire cheetah.</p> <p>To my surprise, something inside me awakens as a man from each clan shows me the ways of the shifters. From pleasures beyond my wildest imagination to the darkest horrors, I am drawn into the secret world of shifters, where every man wears two faces and a vulnerable human body like mine is a liability.</p> <p>As we navigate the hidden dangers of the feline world, truths about our own kingdom come to light, and I must decide how much I’ll give to get my sister to the throne—and if I even want her there.</p> <p>Perfect for listeners who love:</p> <p></p> <ul> <li>Hot reverse harem/\"why choose\" romance</li> <li>Dark romance with triggers and taboo themes</li> <li>Badass princesses with big hearts</li> <li>A plot full of twists and turns, quests, and political intrigue</li> <li>Panty-melting steamy scenes</li> <li>Scheming royals</li> <li>Sexy big cat shifters</li> <li>Fated mates and mating frenzy</li> </ul> <p>Scroll up and click \"buy now\" to binge the series today!</p> <p>Note: Contains material and themes not suitable for listeners under 18 or those with triggers.</p>"; 
